import{Link} from 'react-router-dom';

const Products = () => {
    return <section><h1>The Products Page</h1>

    <ul>
        <Link to ='/products/p1'>A book</Link> 
        <Link to ='/products/p2'>A Carpet</Link >
        <Link to ='/products/p3'>An Online Class</Link >
    </ul>
    </section>
};

export default Products;
